export class FlowStructureNode {
  constructor(line, endLine, column, type, attributes, forwards = undefined) {
    this.attributes = {};
    this.line = line;
    this.endLine = endLine;
    this.column = column;
    this.type = type;
    this.forwards = forwards;
    this.attributes = attributes !== null && attributes !== void 0 ? attributes : [];
    this.name = this.getName();
    this.positions = this.getPositions();
  }

  getName() {
    if (this.attributes['name']) {
      return this.attributes['name'].value;
    } else if (this.attributes['path']) {
      return this.attributes['path'].value;
    }

    return this.type;
  }

  getPositions() {
    let x = 0;
    let y = 0;

    if (this.attributes['x']) {
      x = +this.attributes['x'].value;
    }

    if (this.attributes['y']) {
      y = +this.attributes['y'].value;
    }

    return [x, y];
  }

}
